export default function addCustomFonts(jsPDF: any) {
  (function(jsPDFAPI) {
    let font =
      	"";
    var callAddFont = function() {
      this.addFileToVFS("DejaVuSans-normal.ttf", font);
      this.addFont("DejaVuSans-normal.ttf", "DejaVuSans", "normal");
    };
    jsPDFAPI.events.push(["addFonts", callAddFont]);
  })(jsPDF.API);
  (function(jsPDFAPI) {
    var font =
      "";
    var callAddFont = function() {
      this.addFileToVFS("segoe-normal.ttf", font);
      this.addFont("segoe-normal.ttf", "segoe", "normal");
    };
    jsPDFAPI.events.push(["addFonts", callAddFont]);
  })(jsPDF.API);
  (function(jsPDFAPI) {
    var font =
      "";
    var callAddFont = function() {
		this.addFileToVFS('segoe-bold.ttf', font);
		this.addFont('segoe-bold.ttf', 'segoe', 'bold');
    };
    jsPDFAPI.events.push(['addFonts', callAddFont]);
  })(jsPDF.API);
}
